demo.repl.help:
Tilgjengelige kommandoer:
  @show              ─ vis sammendraget av det siste adaptive-kortet
  @json              ─ skriv ut den rå JSON-verdien mottatt fra flyten
  @back              ─ gå tilbake til forrige blokkerte kort/inndata
  @input <k>=<v>     ─ sett eller overstyr et inndatafelt
  @click <action_id> ─ send inn kortet med den angitte handlingen
  @help              ─ skriv ut denne hjelpeteksten
  @quit              ─ avslutt REPL
